import { useState } from 'react'
import Note from './components/Note'

const App = ({ notes }) => {
  return (
    <>
      <>
        <h1>My Notes</h1>
        {notes.map((note) => {
          return <Note note={note} key={note.id} />
        }
        )}
      </>
      <>
        <form>
          <input />
          <button type='submit' />
        </form>
      </>
    </>
  )
};

export default App;
